var RoleGuard = (route, state) => {
  const auth = inject(AuthService);
  const router = inject(Router);
  const expectedRole = route.data?.["role"];
  const user = auth.getUser();
  if (user && user.role === expectedRole) {
    return true;
  }
  router.navigate(["/not-found"]);
  return false;
};

